import React from 'react';
import { NavLink } from 'react-router-dom'
import { Navbar, Nav } from 'react-bootstrap';


class Navigation extends React.Component {
    render() {
        return(
            <div>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand><b>Hikr</b></Navbar.Brand>
                <Nav className="mr-auto">
                <NavLink to='/' style={{ padding: '10px', color: "#eeddcc" }}>Home</NavLink>
                <NavLink to='/hikingtrails' style={{ padding: '10px', color: "#eeddcc" }}>Hiking Trails</NavLink>
                <NavLink to='/profile' style={{ padding: '10px', color: "#eeddcc" }} activeStyle={{ border: "white" }}>Profile</NavLink>
                </Nav>
                <NavLink to="/login" style={{ padding: '10px', color: "" }}>Login</NavLink>
            </Navbar>
            <br />
            </div>
        )
    }
}

export default Navigation
